import React, { useState, useEffect, useCallback } from 'react';
import { connectToWebSocket, subscribeToTokens, unsubscribeFromTokens } from '../services/websocketService';
import './RealtimeInspector.css';

const RealtimeInspector = () => {
  // Using state to store option chain data for component functionality
  const [optionChainData, setOptionChainData] = useState(null);
  const [subscriptions, setSubscriptions] = useState([]);
  const [subscriptionUpdates, setSubscriptionUpdates] = useState({});
  const [tokenSearch, setTokenSearch] = useState('');
  const [availableTokens, setAvailableTokens] = useState([]);
  const [isLoading, setIsLoading] = useState(true);
  const [connectionError, setConnectionError] = useState(null);

  const handleInitialData = useCallback((data) => {
    console.log('Received initial data:', data);
    setOptionChainData(data);
    setIsLoading(false);

    // Prepare available tokens list
    const tokens = [
      { token: 'UNDERLYING', label: 'Underlying Asset', type: 'UNDERLYING' },
      ...data.strikes.flatMap(strike => [
        { 
          token: strike.call.token, 
          label: `CALL ${strike.strike}`, 
          type: 'CALL', 
          strike: strike.strike 
        },
        { 
          token: strike.put.token, 
          label: `PUT ${strike.strike}`, 
          type: 'PUT', 
          strike: strike.strike 
        }
      ])
    ];
    setAvailableTokens(tokens);
  }, []);

  const handlePriceUpdate = useCallback((data) => {
    console.log('Received price update:', data);
    setSubscriptionUpdates(prev => {
      const newUpdates = { ...prev };

      Object.entries(data).forEach(([token, update]) => {
        if (!newUpdates[token]) {
          newUpdates[token] = {
            values: [],
            currentPrice: update.currentPrice,
            percentChange: update.percentChange
          };
        } else {
          newUpdates[token].currentPrice = update.currentPrice;
          newUpdates[token].percentChange = update.percentChange;
        }

        // Keep only the last 20 updates for the chart
        newUpdates[token].values = [
          ...newUpdates[token].values.slice(-19),
          update.currentPrice
        ];
      });

      return newUpdates;
    });
  }, []);

  const handleSubscriptionUpdate = useCallback((subs) => {
    console.log('Subscription update:', subs);
    setSubscriptions(subs);
  }, []);

  // Handle clean unsubscribe on unmount
  const cleanupSubscriptions = useCallback(() => {
    if (subscriptions.length > 0) {
      console.log('Cleaning up subscriptions:', subscriptions);
      unsubscribeFromTokens(subscriptions);
    }
  }, [subscriptions]);

  useEffect(() => {
    let mounted = true;
    // Connect to WebSocket and set up handlers
    try {
      connectToWebSocket({
        onInitialData: (data) => {
          if (mounted) handleInitialData(data);
        },
        onPriceUpdate: (data) => {
          if (mounted) handlePriceUpdate(data);
        },
        onSubscriptionUpdate: (subs) => {
          if (mounted) handleSubscriptionUpdate(subs);
        },
        onError: (error) => {
          console.error('WebSocket error:', error);
          if (mounted) setConnectionError('Connection error: ' + error.message);
        }
      });
    } catch (error) {
      console.error('Failed to connect to WebSocket:', error);
      if (mounted) setConnectionError('Failed to connect to WebSocket server');
    }

    return () => {
      mounted = false;
      cleanupSubscriptions();
    };
  }, [handleInitialData, handlePriceUpdate, handleSubscriptionUpdate, cleanupSubscriptions, subscriptions]);

  const handleTokenSubscribe = (token) => {
    console.log('Subscribing to token:', token);
    subscribeToTokens([token]);
  };

  const handleTokenUnsubscribe = (token) => {
    console.log('Unsubscribing from token:', token);
    unsubscribeFromTokens([token]);
  };

  const filteredTokens = availableTokens.filter(item => 
    item.label.toLowerCase().includes(tokenSearch.toLowerCase())
  );

  if (isLoading) {
    return <div className="loading">Loading data...</div>;
  }

  if (connectionError) {
    return <div className="error">{connectionError}</div>;
  }

  // Using optionChainData in the component to fix the unused variable warning
  const hasOptionData = Boolean(optionChainData);

  return (
    <div className="realtime-inspector">
      <div className="inspector-sidebar">
        <div className="search-container">
          <input
            type="text"
            placeholder="Search tokens..."
            value={tokenSearch}
            onChange={(e) => setTokenSearch(e.target.value)}
            className="token-search"
          />
        </div>
        <div className="tokens-list">
          {hasOptionData && filteredTokens.map((item) => (
            <div key={item.token} className="token-item">
              <div className="token-info">
                <div className="token-label">{item.label}</div>
                <div className="token-type">{item.type}</div>
              </div>
              {subscriptions.includes(item.token) ? (
                <button 
                  className="token-action unsubscribe"
                  onClick={() => handleTokenUnsubscribe(item.token)}
                >
                  Unsubscribe
                </button>
              ) : (
                <button 
                  className="token-action subscribe"
                  onClick={() => handleTokenSubscribe(item.token)}
                >
                  Subscribe
                </button>
              )}
            </div>
          ))}
        </div>
      </div>

      <div className="inspector-content">
        <h2>Active Subscriptions</h2>
        {subscriptions.length === 0 ? (
          <div className="no-subscriptions">
            No active subscriptions. Subscribe to tokens to see real-time updates.
          </div>
        ) : (
          <div className="subscription-grid">
            {subscriptions.map(token => {
              const data = subscriptionUpdates[token] || { currentPrice: '-', percentChange: 0, values: [] };
              const tokenInfo = availableTokens.find(t => t.token === token) || {};

              return (
                <div key={token} className="subscription-card">
                  <div className="subscription-header">
                    <div className="subscription-title">{tokenInfo.label || token}</div>
                    <button 
                      className="subscription-close"
                      onClick={() => handleTokenUnsubscribe(token)}
                    >
                      Ã—
                    </button>
                  </div>

                  <div className="subscription-body">
                    <div className="price-display">
                      <div className="current-price">{data.currentPrice !== '-' ? data.currentPrice.toFixed(2) : '-'}</div>
                      <div className={`price-change ${data.percentChange >= 0 ? 'positive' : 'negative'}`}>
                        {data.percentChange >= 0 ? '+' : ''}{data.percentChange !== undefined ? data.percentChange.toFixed(2) : 0}%
                      </div>
                    </div>

                    {data.values.length > 0 && (
                      <div className="price-chart">
                        <div className="chart-container">
                          {data.values.map((value, index) => {
                            const min = Math.min(...data.values);
                            const max = Math.max(...data.values);
                            const range = max - min || 1;
                            const height = ((value - min) / range) * 100;
                            const isPositive = index > 0 ? value >= data.values[index - 1] : true;

                            return (
                              <div 
                                key={index} 
                                className={`chart-bar ${isPositive ? 'positive' : 'negative'}`}
                                style={{ height: `${Math.max(5, height)}%` }}
                              />
                            );
                          })}
                        </div>
                      </div>
                    )}
                  </div>
                </div>
              );
            })}
          </div>
        )}
      </div>
    </div>
  );
};

export default RealtimeInspector;
